import React, { useEffect, useState } from 'react';
import { useLocation, useParams } from 'react-router-dom';

const CreateCooperationObjects = () => {
    const location = useLocation();
    const { id } = useParams(); // ID на кооперацията от URL-то

    const [cooperation, setCooperation] = useState({
        id: id || '',
        name: '',
        rsp: ''
    });

    useEffect(() => {
        if (location.state && location.state.building) {
            setCooperation({
                id: location.state.building.id || '',
                name: location.state.building.title || 'Unknown Cooperation',
                rsp: location.state.building.rsp || ''
            });
        }
    }, [location.state]);

    return (
        <div>
            <h2>Create Objects for {cooperation.name}</h2>
            <p>Cooperation ID: {cooperation.id}</p>
            <p>RSP: {cooperation.rsp}</p>
            {/* Полетата за създаване на обекти */}
        </div>
    );
};

export default CreateCooperationObjects;
